import './App.css';
import Cards from './components/Cards.jsx';
import characters, { Rick } from './data.js';
import Nav from './components/NavBar';
function App() {
   return (
      <div className='App' style= {{padding: '25px'}}>
         <Nav/>
         <div>
            <Cards
            characters={characters}
            />
         </div>
      </div>
   );
}

export default App;
